import Table from './components/Table.vue'
import Login from './components/Login.vue'
import Workflow from './components/Workflow.vue'


export const routes = [
 { path: '/', component: Login},
 { path: '/table', component: Table},
 { path: '/workflow', component: Workflow}

];
